import React from 'react';

function DataStorage({ showDataStorage, toggleDataStorage }) {
  return (
    <div className="details-container">
      <button className="expand-button" onClick={toggleDataStorage}>
        {showDataStorage ? "Hide" : "Show"} Data & Storage
      </button>
      {showDataStorage && (
        <ul className="user-details">
          <li>Data Usage</li>
          <li>Storage Space</li>
          <li>Download Your Data</li>
          <li>Backup Data</li>
        </ul>
      )}
    </div>
  );
}

export default DataStorage;
